import  React from "react";
function Videos(props) {
  return (
    <>
      {props.show && (
        <form>
          <lable htmlFor="title">Title</lable>
          <input id="title"></input>
          <lable htmlFor="url">Url</lable>
          <input></input>
        </form>
      )}
    </>
  );  
}
export default Videos;
